webpackJsonp([32487783278060],{4221:function(e,t){e.exports={data:{challengeNode:{title:"Nest Many Elements within a Single div Element",description:["The <code>div</code> element, also known as a division element, is a general purpose container for other elements.","The <code>div</code> element is probably the most commonly used HTML element of all.","Just like any other non-self-closing element, you can open a <code>div</code> element with <code>&#60;div&#62;</code> and close it on another line with <code>&#60;/div&#62;</code>.","<hr>",'Nest your "Things cats love" and "Things cats hate" lists all within a single <code>div</code> element.','Hint: Try putting your opening <code>div</code> tag above your "Things cats love" <code>p</code> element and your closing <code>div</code> tag after your closing <code>ol</code> tag so that both of your lists are within one <code>div</code>.'],challengeType:0,fields:{slug:"/responsive-web-design/basic-html-and-html5/nest-many-elements-within-a-single-div-element",blockName:"Basic HTML and HTML5",tests:[{text:"Nest your <code>p</code> elements inside your <code>div</code> element.",testString:'assert($("div").children("p").length > 1, \'Nest your <code>p</code> elements inside your <code>div</code> element.\');'},{text:"Nest your <code>ul</code> element inside your <code>div</code> element.",testString:'assert($("div").children("ul").length > 0, \'Nest your <code>ul</code> element inside your <code>div</code> element.\');'},{text:"Nest your <code>ol</code> element inside your <code>div</code> element.",testString:'assert($("div").children("ol").length > 0, \'Nest your <code>ol</code> element inside your <code>div</code> element.\');'},{text:"Make sure your <code>div</code> element has a closing tag.",testString:"assert(code.match(/<\\/div>/g) && code.match(/<\\/div>/g).length === code.match(/<div>/g).length, 'Make sure your <code>div</code> element has a closing tag.');"}]},required:[],files:{indexhtml:{key:"indexhtml",ext:"html",name:"index",contents:'<h2>CatPhotoApp</h2>\n<main>\n  <p>Click here to view more <a href="#">cat photos</a>.</p>\n  \n  <a href="#"><img src="https://bit.ly/fcc-relaxing-cat" alt="A cute orange cat lying on its back."></a>\n  \n  <p>Things cats love:</p>\n  <ul>\n    <li>cat nip</li>\n    <li>laser pointers</li>\n    <li>lasagna</li>\n  </ul>\n  <p>Top 3 things cats hate:</p>\n  <ol>\n    <li>flea treatment</li>\n    <li>thunder</li>\n    <li>other cats</li>\n  </ol>\n  \n  <form action="/submit-cat-photo">\n    <label><input type="radio" name="indoor-outdoor" checked> Indoor</label>\n    <label><input type="radio" name="indoor-outdoor"> Outdoor</label><br>\n    <label><input type="checkbox" name="personality" checked> Loving</label>\n    <label><input type="checkbox" name="personality"> Lazy</label>\n    <label><input type="checkbox" name="personality"> Energetic</label><br>\n    <input type="text" placeholder="cat photo URL" required>\n    <button type="submit">Submit</button>\n  </form>\n</main>',head:"",tail:""},indexjs:null,indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/responsive-web-design/basic-html-and-html5/declare-the-doctype-of-an-html-document",id:"bad87fee1348bd9aede08835"},slug:"/responsive-web-design/basic-html-and-html5/nest-many-elements-within-a-single-div-element"}}}});
